import classes from "./Skills.module.css";
import Container from "react-bootstrap/esm/Container";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Skills = () => {
    return ( 

        <section id="prof" className={classes.skills}>
            <Container>
                <div className={classes.skills__container}>
                    <h3 className={classes.skills__header}>Proficiencies</h3>
                    <Row>
                        <Col md={6}>
                            <h6 className={classes.skills__subheader}>Skills</h6>
                            <p className={classes.skills__list}><span className={classes.skills__key}>Programming Languages:</span> Python, Java, JavaScript, C, SQL</p>
                            <p className={classes.skills__list}><span className={classes.skills__key}>Libraries/Frameworks:</span> React.js, Vue.js, Express.js, Material-UI, Bootstrap</p>
                            <p className={classes.skills__list}><span className={classes.skills__key}>Misc:</span> AWS, Azure, CSS, HTML, PostgreSQL, Unix, Git, Jenkins</p>
                        </Col>
                        <Col md={6}>
                            <h6 className={classes.skills__subheader}>Certifications</h6>
                            <p className={classes.skills__cert}>AWS Cloud Practitioner - Feb 2023</p>
                            <p className={classes.skills__cert}>Azure Cloud Fundamentals - Feb 2023</p>
                        </Col>
                    </Row>
                </div>
                </Container> 

        </section>
     );
}

export default Skills;
